import React from 'react';
import PropTypes from 'prop-types';


const FullLogoLight = ({ width, height }) => {
	return (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
			width={height !== 951 ? (height * (2842 / 951) + 15) : width}
			height={width !== 2842 ? width * (951 / 2842) : height}
			viewBox='0 0 2842 951'
            fill='none'
        >
            <image
            id="Full_Logo_light"
            data-name="full-logo-light"
            x={0}
            y={-40}
            width={2842}
            height={951}
                xlinkHref="data:img/png;base64,"            
            />
        </svg>
	);
};
FullLogoLight.propTypes = {
	width: PropTypes.number,
	height: PropTypes.number,
};
FullLogoLight.defaultProps = {
	width: 2842,
	height: 951,
};

export default FullLogoLight;

